INSERT INTO `twitter_poster` VALUES ('1', 'haydenzadams', 'People are shocked to hear our team is only 11 people. Anyone who joins can have a major impact.  If interested, we\'d love for you to apply. Or tell your developer friends to apply instead! Quote Tweet Uniswap Protocol  Do you want to help build the future of decentralized finance? The Uniswap dev team is hiring for 4 engineering roles!  Senior Frontend Engineer  Smart Contract Engineer  Full Stack Engineer  Software Engineer Intern  Learn more and apply: **ht**tps://jobs.lever.co/Uniswap', '2021-01-06 05:53:51', '2021-02-20 17:40:26'), ('2', 'haydenzadams', ' @PoolTog**eth**er_  and  @radicle  are the latest compound governance forks added to http://Sybil.org!!! Are we missing any?  Some work being done to enable other gov systems.  Sharing infrastructure is a powerful force in defi  Quote Tweet Matteo Leibowitz great to see more governance systems integrate with sybil   register yourself as a delegate today http://sybil.org', '2021-02-19 01:18:53', '2021-02-20 17:40:26'), ('3', 'justinsuntron', 'I’M BACK! While on a break from Twitter, I’ve been spending time strategizing about our eco**sys**tem, see below for what I have in store ', '2021-02-19 15:16:01', '2021-02-20 17:40:26'), ('4', 'justinsuntron', '#TRON  will catch up. #**TRX**  https://twitter.com/udiWertheimer/status/1362692027490648067… This Tweet is unavailable.', '2021-02-19 17:21:24', '2021-02-20 17:40:26'), ('5', 'justinsuntron', 'http://Justswap.org keeps going! #TRON  #**TRX**  $**TRX** #JST #JUST', '2021-02-19 16:40:17', '2021-02-20 17:40:26'), ('6', 'justinsuntron', '#SaveRo**ar**ingKitty Quote Tweet The Chairman #SaveRo**ar**ingKitty Show this thread', '2021-02-19 15:45:29', '2021-02-20 17:40:26'), ('7', 'justinsuntron', 'You have my support.  @wsbmod Quote Tweet wallstreetbets mod They didn\'t want us to release this. They foug**ht** hard to prevent us from sharing this video we made with you, but now we DGAF and it\'s time for you to s